#include <iostream>
#include <c++/4.8.3/cstring>

using namespace std;


char input[] =
        "\n"
        "\n"
        "\n"
        "\n"
        "\n";

int pad[3][3] = {{1,2,3},
                 {4,5,6},
                 {7,8,9}};

int x = 1;
int y = 1;

int main()
{
std::string result = "";
     for (int i = 0; i < strlen(input); i++){
            if (input[i] == '\n'){
                result += std::to_string(pad[x][y]);
            }
            switch (input[i]){
                case 'L':
                    y--;
                    break;
                case 'R':
                    y++;
                    break;
                case 'U':
                    x--;
                    break;
                case 'D':
                    x++;
                    break;
            }
            if (x < 0) x = 0;
            if (x > 2) x = 2;
            if (y < 0) y = 0;
            if (y > 2) y = 2;
     }

    cout << result << endl;
    return 0;
}

